import React from "react";
import Footer from "./Footer";
import Account from "./Account";
import Mail from "./Mail";
import Header from "./Header"


const Sign = () => {
    return (
        <>


            <Header />
            <Account />
            <Mail />
            <Footer />

        </>
    )
}

export default Sign
